import React, { useState } from 'react';
import SettingsPanel from './SettingsPanel.js';

const SettingsPage = () => {

  return (
    <div className="App">
      <h1>Settings Page</h1>
      <div>
        <h1>
        If the metric requires a statistic to be farther away from the goal, choose edge.<br></br>
        If the metric requires a statistic to be as close as possible to the goal, choose target.

        </h1>
      </div>
      <div>
        <SettingsPanel title = 'Velocity'/>
        <SettingsPanel title = 'Ind. Vertical Break'/>
        <SettingsPanel title = 'Horizontal Break'/>
        <SettingsPanel title = 'Spin Rate'/>
      </div>
      <div>
        <SettingsPanel title = 'Relative Height'/>
        <SettingsPanel title = 'Extension'/>
        <SettingsPanel title = 'Vertical App Angle'/>
      </div>

    </div>
  );
};

export default SettingsPage;
